INSERT INTO `faqs` (`id`, `question`, `answer`, `created_at`, `updated_at`) VALUES
(1,	'Is My Electronic Health Record Kept Private?',	'Health records are kept totally private and we employ robust encryption methods to protect your personal information. You determine who can see the information in your record.',	'2022-11-28 07:31:07',	'2022-11-28 07:31:07'),
(2,	'Can Doctor 24x7 Handle My Emergency Situations?',	'Doctor 24×7 is designed to handle non-emergent medical problems. You should NOT use it if you are experiencing a medical emergency.',	'2022-11-28 07:31:07',	'2022-11-28 07:31:07'),
(3,	'Can I Call Doctor 24x7 Outside Of India?',	'Doctor 24×7 consults are unavailable outside of India. However, if you are travelling outside India, you can use our service from a mobile phone using a SIM card issued in India.',	'2022-11-28 07:31:07',	'2022-11-28 07:31:07'),
(4,	'Is my electronic health record kept private?',	'Health records are kept totally private and we employ robust encryption methods to protect your personal information. You determine who can see the information in your record.',	'2022-11-28 07:31:07',	'2022-11-28 07:31:07'),
(5,	'How much does a consult cost?',	'The cost of a Doctor consult varies, depending on your choice of consulting the 1st available Doctor OR requesting a call back from a specific Doctor.',	'2022-11-28 07:31:07',	'2022-11-28 07:31:07'),
(6,	'Do I Talk to \"real doctors\"?',	'Yes. Doctor 24×7 subscribers only talk to reputed Doctors/Experts attached with top hospitals/private practice who are Licensed practitioners. Each Doctor/Expert on our network is qualified.',	'2022-11-28 07:31:07',	'2022-11-28 07:31:07');
